<style>
  :root{
  --whois-bg: #ffffff;
  --whois-fg: #0f1115;
  --whois-muted: #556;
  --whois-border: #e7e9ee;
  --whois-soft: #f7f8fb;
  --whois-radius: 14px;
  --whois-gap: 12px;
  --whois-shadow: 0 6px 24px rgba(16,24,40,.06);
  --whois-font: system-ui,-apple-system,Segoe UI,Roboto,Ubuntu,Arial,sans-serif;
}

.whois-card{
  font-family: var(--whois-font);
  max-width: 760px;
  margin: 16px auto;
  padding: 20px 22px;
  background: var(--whois-bg);
  color: var(--whois-fg);
  border: 1px solid var(--whois-border);
  border-radius: var(--whois-radius);
  box-shadow: var(--whois-shadow);
}

.whois-card h2{
  margin: 0 0 14px;
  font-size: 20px;
  line-height: 1.2;
  letter-spacing: .2px;
}

.whois-grid{
  display: grid;
  gap: var(--whois-gap);
}

.whois-card .row{
  display: grid;
  grid-template-columns: 180px 1fr;
  align-items: start;
  gap: 14px;
  padding: 12px 14px;
  background: var(--whois-soft);
  border: 1px solid var(--whois-border);
  border-radius: 12px;
  transition: transform .15s ease, background-color .2s ease, border-color .2s ease;
}

.whois-card .row:hover{
  transform: translateY(-1px);
  background: #fff;
  border-color: #dfe3ea;
}

.whois-card .k{
  font-weight: 600;
  color: var(--whois-muted);
  letter-spacing: .1px;
}

.whois-card .v{
  color: var(--whois-fg);
  word-break: break-word;
  white-space: pre-wrap;
}

/* Peque√±os detalles tipogr√°ficos */
.whois-card .v a{ text-decoration: none; border-bottom: 1px dotted #c7ccd6; }
.whois-card .v a:hover{ border-bottom-style: solid; }

/* Responsivo */
@media (max-width: 640px){
  .whois-card{ padding: 18px; }
  .whois-card .row{ grid-template-columns: 1fr; }
  .whois-card h2{ font-size: 18px; }
}

/* Modo oscuro autom√°tico */
@media (prefers-color-scheme: dark){
  :root{
    --whois-bg: #0f1115;
    --whois-fg: #e8ebf1;
    --whois-muted: #c3c8d4;
    --whois-border: #222837;
    --whois-soft: #141925;
    --whois-shadow: none;
  }
  .whois-card .row:hover{
    background: #101522;
    border-color: #2a3650;
  }
}

</style>
